import React from 'react'
import './App.css';

const BlockButton = ({ onClick, label, style, customContent }) => {

  const renderCustom = customContent
  const renderDefault = (
    <div 
      className="block-button"
      style={style}
      onClick={onClick}>
      <label>{label}</label>
    </div>
  )

  return (
    customContent ? renderCustom : renderDefault
  )
}

export default BlockButton;
